import React, { useState } from "react";

import "./MobileNav.module.css";

const MobileNav = () => {
    const [open, setOpen] = useState(false);

    return (
        <>
            <div
                open={open}
                className={`mobile-nav ${open ? "mobile-nav-open" : ""}`}
                onClick={() => setOpen(!open)}
            >
                <div />
                <div />
                <div />
            </div>
        </>
    );
};
export default MobileNav;
